import styles from './Proper.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Proper(prop) {
    let checkAvatarIcon = (prop) => {
        if(prop.avatar) {
            return <img src={prop.avatar} alt="" className={styles['avatar']}/>
        }else {
            return <FontAwesomeIcon className={styles['icon']} icon={prop.icon} />
        }
    }
    return ( 
        <>
        <div className={styles['row-menu']}>
           {
            checkAvatarIcon(prop)
           }
            <p className={styles['text']}>{prop.searchValue}</p>
        </div>
        </>
     );
}

export default Proper;
